import styled from "styled-components";

export const Container = styled.div`
    max-width: 1120px;
    margin: 20 auto;
    width: 98%;
    background-color: #fff;
    box-shadow
    display: flex;
    gap: 20px;
    margin-top: -50px;
    justify-content: space-around;

`
